import React , {useState} from 'react'

function Front(props){
  const [counter,setCounter]=useState(0);
  const plu=()=>{
      let c=counter;
      c++;
      setCounter(c)
  }
  return(
    <div>
      <label htmlFor={props.id} style={{width:"20px",height:"20px"}}>{props.value}</label>
      <input type="number" id={props.id}/>
      <input type="button" value="+" onClick={plu} />
    </div>
  );
}
export default Front
